import React, {Component} from "react";
import { connect } from "react-redux";

import { retrieveProducts } from "../../../store/product_slice";
import { findOrderLineByOrderID } from "../../../store/orderline_slice";

class ProductInfo extends Component {
	constructor(props) {
	  super(props);

	  this.getProducts = this.getProducts.bind(this);
      this.findOrderLinesByID = this.findOrderLinesByID.bind(this);

	  this.state = {
        orderID: "",
		invoiceNumber: "NA",
		revenue: "",
		expense: "",
		isPaid: "",
	 };
	}

	// This gets the users when the component loads
	componentDidMount() {
		this.ret(this.props.order)
	}

    getProducts(id, order) {
		this.props
			.retrieveCustomer({id})
			.then((data) => {
				console.log(data);
				this.setState({

					firstName: data.payload.firstName,
					lastName: data.payload.lastName,
					datePlaced: order.datePlaced,

					cardIDs: {
						orderId: id,
						customerId: data.payload.customerID,
					}


				});
				this.getInvoiceData(this.props.order.orderID);
			})
			.catch((e) => {
			console.log(e);
			});
	}

	getInvoiceData(id) {

		this.props
			.retrieveInvoice({id})
			.then((data) => {
				console.log(data);
				this.setState({

					invoiceNumber: data.payload.invoiceNumber || 'NA',

				  });
				  this.findOrderLinesByID(this.props.order.orderID);

			  })
			.catch((e) => {
			console.log(e);
			});

	}

	findOrderLinesByID(id) {
		this.props
			.findOrderLineByOrderID({ id })
			.then((data) => {
				console.log(data);

				let i = 0;
				let logs = 0;
				while (i < data.payload.length) {
					logs+= data.payload[i].qtyOrdered;
					console.log(data.payload[i]);
					i++;
				}

				this.setState({
					numberOfLogs: logs
				});
			})
			.catch((e) => {
				console.log(e);
			});
	}

	render() {
		const {orderlines} = this.props;
		console.log(orderlines);

		const {invoiceNumber, revenue, expense, isPaid} = this.state;
        console.log(invoiceNumber)

        return (
            <div id='OrderView_Products_Details'>
            <h4 style={{fontWeight: 'bold'}}>Flavor Information</h4>
            <div className='Row'>
                <table>
                    <tr>
                        <th><h4 style={{fontWeight: 'bold'}}>Name</h4></th>
                        <th><h4 style={{fontWeight: 'bold'}}>SKU</h4></th>
                        <th><h4 style={{fontWeight: 'bold'}}>Quantity</h4></th>
                    </tr>
                    {order.productsOrdered.map((product) => (
                        <tr>
                            <td><h4>{product.product.name}</h4></td>
                            <td><h4>{product.product.id}</h4></td>
                            <td><h4>{product.quantity}</h4></td>
                        </tr>					
                    ))}
                </table>
                <table>
                    <tr>
                        <th><h4 style={{fontWeight: 'bold'}}>At a Glance:</h4></th>
                    </tr>
                    <tr>
                        <td><h4 style={{fontWeight: 'bold'}}>Total Number of Logs:</h4></td>
                        <td><h4>{numberOfLogs}</h4></td>
                    </tr>
                    <tr>
                        <td><h4 style={{fontWeight: 'bold'}}>Total Number of Flavors:</h4></td>
                        <td><h4>{numberOfFlavors}</h4></td>
                    </tr>
                </table>
            </div>
            </div> 
        );	
	}
  }


  // Mapping only the parts of the redux store that we want to work with on this component
  const mapStateToProps = (state) => {	
	return {
        products: state.products,
        orderlines: state.orderline,
    };
  };

export default connect(mapStateToProps, { retrieveProducts, findOrderLineByOrderID })(ProductInfo);
